import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Logs = () => {
  const [data, setData] = useState({ hits: [] })

  useEffect(async () => {
    const result = await axios(
      'https://hn.algolia.com/api/v1/search?query=redux'
    )

    setData(result.data)
  }, [])

  return (
    <div>
      <h1>logs</h1>
    </div>
  )
}

export default Logs
